PREFIX ns3: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?department
WHERE {
  ?department rdf:type ns3:Department .
  FILTER NOT EXISTS {
    ?manager rdf:type ns3:Manager .
    ?department ns3:hasManager ?manager .
  }
}

PREFIX ns3: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?hardware ?name
WHERE {
  ?hardware rdf:type ns3:Hardware ;
            ns3:name ?name .
  FILTER NOT EXISTS {
    ?hardware ns3:hasProductManager ?productManager .
    ?productManager ns3:status "active" .
  }
}

PREFIX ns3: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>

SELECT (COUNT(DISTINCT ?supplier) AS ?supplierCount)
WHERE {
  ?product rdf:type ns3:HardwareShape ;
           ns3:compatibleWith <http://ld.company.org/prod-vocab/K367_Strain_Encoder> .
  ?alternativeProduct rdf:type ns3:HardwareShape ;
                      ns3:compatibleWith ?product ;
                      FILTER (?alternativeProduct != <http://ld.company.org/prod-vocab/K367_Strain_Encoder>) .
  ?supplier rdf:type ns3:SupplierShape ;
            ns3:canDeliver ?alternativeProduct .
}
